    using System.Collections.Generic;
    using Neovolve.CodeAnalysis.ChangeTracking.Models;

    public static class MethodModifiersChangeTable
    {
        private static readonly Dictionary<MethodModifiers, Dictionary<MethodModifiers, SemVerChangeType>>
            _modifierChanges =
                BuildModifierChanges();

        public static SemVerChangeType CalculateChange(ItemMatch<IMethodDefinition> match)
        {
            var oldModifiers = match.OldItem.Modifiers;
            var newModifiers = match.NewItem.Modifiers;

            if (oldModifiers == newModifiers)
            {
                // There is no change in the modifiers
                return SemVerChangeType.None;
            }

            var possibleChanges = _modifierChanges[oldModifiers];

            return possibleChanges[newModifiers];
        }

        private static void AddModifierChange(
            IDictionary<MethodModifiers, Dictionary<MethodModifiers, SemVerChangeType>> changes,
            MethodModifiers oldModifier, MethodModifiers newModifiers, SemVerChangeType changeType)
        {
            if (changes.ContainsKey(oldModifier) == false)
            {
                changes[oldModifier] = new Dictionary<MethodModifiers, SemVerChangeType>();
            }

            changes[oldModifier][newModifiers] = changeType;
        }

